import './App.css';

 import { Homedsc,Navbar ,Footer} from './conponents';
import { Homepage ,Predictresults} from './containers';
import {BrowserRouter , Routes , Route} from 'react-router-dom';  
import Home from './conponents/Home';
function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' element={Home} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
